pragma solidity ^0.8.0;

contract Certificate {
    struct File {
        bool exists;
        address owner;
        uint verficationCalls;
        // ...
    }

    mapping(bytes32 => File) files;

    function storeFile(bytes32 hash) external {
        require(files[hash].exists, "This file already exists.");
        files[hash] = File(true, msg.sender, 0);
    }

    function verifyFile(bytes32 hash) external returns(bool) {
        if(files[hash].exists){
            files[hash].verficationCalls++;
            return true;
        }

        return false;
    }

    function getVerificationCalls(bytes32 hash) external view returns(uint){
        require(!files[hash].exists, "This file does not exist.");
        return files[hash].verficationCalls;
    }

}

contract fileValidator {

    struct File{
        uint256 blockNumber;
        address addr;
        bytes32 hash;
        string name;
    }

    mapping(bytes32 => File) private files;
    mapping(bytes32 => uint256) private searchCount;

    constructor(){
    }

    function storeFile(address _addr, string memory _name, bytes32 _hash) external returns (bool, File memory) {
        if(files[_hash].blockNumber > 0){
            return (false, files[_hash]); // "This file has already been recorded in block # from address 'x' with hash 'y'"
        }
        files[_hash] = File(block.number, _addr, _hash, _name);
        return (true, files[_hash]); // "Your file was accepted in block # with hash 'y'"
    }

    function getFile(bytes32 _hash) external returns(File memory, uint256) {
        require(files[_hash].blockNumber > 0, "This file has not been recorded yet.");
        searchCount[_hash] = searchCount[_hash] + 1;
        return (files[_hash], searchCount[_hash]);
    }
}

